type IconProps = {
  className?: string;
  name: string;
  size?: number | string;
  fill?: string;
  iconType?: string;
  viewBox?: string;
};

const Icon = ({
  className,
  name,
  size,
  fill,
  iconType,
  viewBox = "0 0 34 28",
}: IconProps) => {
  return iconType === "svg" ? (
    <svg
      className={className}
      width={size || 24}
      height={size || 24}
      viewBox={viewBox}
      fill={fill}
    >
      {svgIcons[name]}
    </svg>
  ) : (
    <svg
      className={className}
      width={size || 24}
      height={size || 24}
      viewBox="0 0 24 24"
    >
      <path fill={fill} d={icons[name]}></path>
    </svg>
  );
};

export default Icon;
